        @media screen and (min-width: 734px) {
            margin-bottom: 24px;
        }
    }

    &__data {
        display: flex;
        gap: 4px;
    }

    &__catag {
        font-weight: 400;
        font-size: 12px;
        line-height: 1.17;
        color: $general-text-color;
    }

    &__info {
        font-weight: 400;
        font-size: 12px;
        line-height: 1.17;
        color: $title-color;
    }

    &__desc {
        font-weight: 400;
        font-size: 14px;
        line-height: 1.29;
        color: $text-desc-color;

        @media screen and (min-width: 734px) {
            font-size: 16px;
            line-height: 1.25;
        }
    }

    &__down {
        display: flex;
        justify-content: space-between;
        align-items: end;
    }

    &__cost {
        font-weight: 500;
        font-size: 18px;
        line-height: 1.11;
        color: $title-color;

        @media screen and (min-width: 734px) {
            font-weight: 500;
            font-size: 20px;
            line-height: 1.2;
            color: $title-color;
        }
    }

    &__btn {
        font-weight: 500;
        font-size: 14px;
        line-height: 1.29;
        color: $background-fone-color;
        background-color: $accent-color;
        padding: 12px 24px;
        display: flex;
        gap: 10px;
        align-items: center;
        border-radius: 30px;
        fill: $background-fone-color;

        @media screen and (min-width: 734px) {
            font-size: 16px;
            line-height: 1.25;
            padding: 10px 28px;
        }
    }

    &__menu {
        background-color: transparent;
        padding: 0;
        margin: 0;
        position: absolute;
        top: 14px;
        right: 14px;
    }

    &__cross {
        fill: $title-color;
        stroke-width: 10px;
        stroke: aqua;
    }
}

