.green{
    color: $accent-color;
}
.already-sub__logo-icon{
    fill: $title-color;
    align-self: flex-end;
    background: none;
    &:hover {
        fill: $hover-accent-color;
        cursor: pointer;
        transition: 250ms ease-in-out;
    }

}
.already-sub__modal {
    position: fixed;
    top: 0;
    left: 0;
    width: 100%;
    height: 100%;
    background-color: $backdrop-color;
    z-index: 10;
    

}
.modal-content {
    position: absolute;
    top: 50%;
    left: 50%;
    transform: translate(-50%, -50%);
    width: 469px;
    background-color: white;
    padding: 20px;
    border-radius: 8px;
    box-shadow: 0 2px 10px $basket-line-color;
    z-index: 9;
    display: flex;
    flex-direction: column;
    align-items: center;
    height: 308px;
    gap: 60px;
    @media screen and (max-width: 768px) {
            width: 335px;
            height: 276px;
            gap: 40px;
        
    }
}
.already-sub__title {
    font-weight: 500;
    font-size: 24px;
    line-height: 1;
    text-align: center;
    max-width: 250px;
    font-family: NeueMontreal-Medium, sans-serif;
}
.already-sub__text {
    color: $backdrop-color;
    font-family: NeueMontreal-Medium, sans-serif;
    font-weight: 400;
    font-size: 16px;
    line-height: 1.25;
    text-align: center;
    max-width: 350px;
}
.already-sub__text-wrap{
    display: flex;
    flex-direction: column;
    gap: 20px;
    max-width: 350px;
    align-items: center;
}
